import { useEffect } from "react";
import { useCookies } from "react-cookie";
import { Cookie } from "./func";

function Home() {
    const [cookie, , removeCookies] = useCookies();
    useEffect(() => {
        alert("App_Board 테스트 홈페이지입니다.");
        Cookie(cookie, removeCookies);
    }, [cookie, removeCookies]);

    return(
        <div style={{marginTop: "100px", textAlign: "center"}}>
            <b style={{ fontSize: "40px"}}> Home Page </b>
            <p> 
                App_Board Tutorial <br/>
                Java Spring boot / React.js / MySQL Workbench
            </p>
        </div>
    );
};

export default Home;
